h(-12),m(1414,{icon=236807,lore="Kalimdor is home to the night elves, orcs, tauren, trolls, and draenei. Other races present include the ogres, centaur, naga, demons, and other, more minor races.",maps={1464},["zone-text-continent"]=1,g={h(-12,{ach(43,{crit(1601,{achID=43,id=1}),crit(1600,{achID=43,id=1})}),ach(1678,{r=2}),ach(1680,{r=1,rwp=50004})}),m(1457,{icon=255141,isRaid=1,lore="The atmosphere inside the city is quiet and tranquil. It does not have the feeling of confinement that one would feel in Stormwind or Ironforge, where the buildings are grouped close together. Darnassus is open to the sky, and the graceful bridges spanning the lake around which it is built set the buildings wide apart. The elegant bridges, beautiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history.",g={h(-31,{faction(69,{icon=236449,OnTooltip=_.OnTooltipDB.RuneclothTurnIns,r=2})}),h(-45,{q(7799,{coords={{64,23,1457}},cost={{"i",4338,60}},lvl=40,qgs={14725},r=2,rwp=40003}),q(7800,{coords={{64,23,1457}},cost={{"i",14047,60}},lvl=50,qgs={14725},r=2,rwp=40003}),q(7798,{coords={{64,23,1457}},cost={{"i",4306,60}},lvl=26,qgs={14725},r=2,rwp=40003}),q(7792,{coords={{64,23,1457}},cost={{"i",2592,60}},lvl=12,qgs={14725},r=2,rwp=40003}),q(5647,{altQuests={5641,5645},c={5},coords={{39.2,81,1457}},lvl