e between the Burning Steppes and the Searing Gorge, linking the two regions. This zone is deceptively small and appears empty when first entered - however, it is among the most dangerous places in Azeroth. It was hotly contested between the forces of Ragnaros and his Dark Iron servants on one side and the black dragon Nefarian and his orc minions on the other. This is one of the most important areas in World of Warcraft lore.",lvl=40,maps={34,35},["zone-text-areaID"]=25,g={h(-46,{n(9026,{coords={{36.2,36.2,35},{40.6,37.8,35},{37,28.2,35}},g={r(18422,{b=1,itemID=14486,learnedAt=275,q=3,requireSkill=197})}}),n(9046,{description="This used to be a simple Rare Creature with a limited loot table. He was later repurposed for use with the BWL Attunement Quest Chain. The two items listed below were never available in WoW Classic.",g={s(160912,13254,{awp=100107,b=1,f=8,lvl=51,q=3,rwp=10600,u=2}),s(160908,13248,{awp=100107,b=1,f=31,lvl=51,q=3,rwp=10600,u=2}),i(18987,{b=1,lvl=55,q=1,rwp=60003})}}),n(8924,{coords={{37.8,61.3,35},{47.6,62,35}},g={i(19259,{q=3,u=1609}),s(160281,11603,{f=34,lvl=46,q=3})}})}),h(-56,{i(226694,{awp=11503,b=1,c={1,2,4,7,9,11},description="1. Head to the South end of Searing Gorge and enter Blackrock Mountain.\n2. As you enter the main chamber, head left down the circular pathway.\n3. When you come to the meeting stone for Lower Blackrock Spire, turn left and head up the hallway.\n4. Watch out for level 54-ish creatures and take the first right in to a small room.\n5. You will see two copies of the book laying on the floor.\n*One is next to a pair of creatures. Another is in a small nook where you may safely loot the book without pulling aggro.",f=55,providers={{"o",457099}},q=2,u=1608,g={r(459313,{awp=11503,c={1,2,4,7,9,11},u=1608})}})})}}),m(1419,{icon=236720,lore="The Blasted Lands bear that name for a reason: they were twisted by the magic that brought the Dark Portal into being, spewing the rampaging Horde into Azeroth.\n\nThis wasted desert of red clay is home to the original Dark Portal. The portal still stands, and leads to Outland — the remains of the orcs' sundered homeworld, Draenor. Nethergarde Keep, a Stormwind fortress of dour mages and paladins, keeps watch over the portal and the demons and ogres that would abuse its power.\n\nNow, the wretched land hosts few inhabitants and no significant settlements. Magic that leaked through the Dark Portal warped the Blasted Lands, leaving an infertile desert landscape. Hardy desert species like Basilisks, Scorpions and Hyenas have since colonized the area. The red rocks of the region do not come by their color naturally. The original tan color was transmuted into the unearthly crimson by searing heat and chaotic energies when the Dark Portal was destroyed.",g={h(-12,{ach(766,{crit(1280,{achID=42,id=1})})}),h(-30,{exp(1441,{crit(1033,{achID=766,id=1})}),exp(1437,{crit(1028,{achID=766,id=1})}),exp(1439,{crit(1034,{achID=766,id=1})}),exp(1457,{crit(1029,{achID=766,id=1})}),exp(1438,{crit(1030,{achID=766,id=1})}),exp(2517,{crit(1036,{achID=766,id=1})}),exp(1440,{crit(1031,{achID=766,id=1})}),exp(72,{crit(1032,{achID=766,id=1})}),exp(73,{crit(1035,{achID=766,id=1})})}),h(-32,{fp(45,{coords={{65.6,24.4,1419}},crs={8609},r=2})}),h(-45,{q(2583,{coords={{50.6,14.2,1419}},cost={{"i",8394,1},{"i",8393,2},{"i",8392,3}},lvl=45,qgs={7505},rwp=40003,g={i(8411,{b=1,f=55,q=1,rwp=40003})}}),q(3501,{coords={{51.8,35.6,1419}},cost={{"i",10593,1}},lvl=45,qgs={7363},rwp=40003,g={i(12122,{b=1,q=2,rwp=40003})}}),q(2602,{coords={{50.6,14.3,1419}},cost={{"i",8396,2},{"i",8394,10}},lvl=45,qgs={7506},repeatable=1,rwp=40003,g={i(8423,{b=1,f=55,q=1,rwp=40003})}}),q(2522,{coords={{51.8,35.6,1419}},cost={{"i",8244,1}},lvl=45,qgs={7363},repeatable=1,rwp=40003,sourceQuests={2521},g={i(10752,{b=1,q=2,rwp=40003})}}),q(3502,{coords={{51.8,35.6,1419}},cost={{"i",10593,1}},lvl=45,qgs={7363},repeatable=1,rwp=40003,sourceQuests={3501},g={i(12122,{b=1,q=2,rwp=40003})}}),q(2783,{coords={{67.6,19.2,14